import { getToken } from "../../routers/Token";
import { Navigate } from 'react-router-dom'

function AuthRoute({ children }) {
    const isToken = getToken()
    if (isToken) {
        return <>{children}</>
    } else {
        return <Navigate to="/login" replace />
    }
}

export { AuthRoute }
